extern GameState *currState;

void createPlayer(GameData &gd, glm::vec2 pos) { // case for player put in one code block
    SDL_FRect collider = { 
        .x = 1,
        .y = 1,
        .w = 28,
        .h = 30 // more accurate at 31, bug caused where player stuck in jump state in small ceilingd
    };
    
    SDL_FRect hookCollider = { 
        .x = 0,
        .y = 0,
        .w = static_cast<float>(HOOK_SIZE),
        .h = static_cast<float>(HOOK_SIZE) // more accurate at 31, bug caused where player stuck in jump state in small ceilingd
    };

    //printf("%d",((LevelState*) currState)->character);
    //Player player2(pos, collider, res.texIdleS, res.playerAnims, res.ANIM_PLAYER_IDLE, 250);
    //gd.player2 = player2;
    
    Player player;
    for(int index = 0; index < 8; index++){
        if(gd.playerTypes[index] != -1){
            if(gd.playerTypes[index]== SWORD){
                player = Player(pos, collider, 250);         
                player.cooldownTimer = Timer(3.0f);
                player.character = SWORD;
            } else if(gd.playerTypes[index] == SHOTGUN){
                player = Player(pos, collider, 250);
                player.cooldownTimer = Timer(5.0f);
                player.character = SHOTGUN;
            } else {
                player = Player(pos, collider, 250);
                player.cooldownTimer = Timer(1.0f);
                player.character = JETPACK;
            }
            
            //player.character = SWORD;
            player.state_ = new IdleState();
            player.dir = 0;
            player.flip = 1;
            player.cooldownTimer.step(5.0f);
            //gd.player2.state_ = newState;

            glm::vec2 hookPos = glm::vec2(-1,-1);
            player.hook = Hook(hookPos, hookCollider);
            player.hook.visible = false;
            player.index = gd.players_.size();
            gd.players_.push_back(player);
        }
    }
    
    // Add itemStorage
    SDL_FRect storageCollider; 
    gd.itemStorage_ = ItemStorage(player.pos, storageCollider);
    
}

void createItemBox(GameData &gd, glm::vec2 pos, SDL_FRect collider) { // case for item box put in one code block
    ItemBox box(pos, collider);
    gd.itemBoxes_.push_back(box);
}

template <typename T>
void placeInGrid(std::vector<T> &o, GameData &gd) { // not in .h file
    for (T &obj : o) {
       gd.grid_[obj.pos.y / TILE_SIZE][obj.pos.x / TILE_SIZE] = &obj; 
    }
}

void createGrid(const SDLState &state, GameData &gd, int rows, int cols) {
    gd.grid_.resize(rows);
    for (auto& row : gd.grid_) {
        row.resize(cols, nullptr); // MAP_ROWS x MAP_COLS array 
    }
    // mapTiles, lasers, portals, water, lava, signs, itemBoxes
    placeInGrid(gd.mapTiles_, gd);
    placeInGrid(gd.lasers_, gd);
    placeInGrid(gd.portals_, gd);
    placeInGrid(gd.water_, gd);
    placeInGrid(gd.lava_, gd);
    placeInGrid(gd.signs_, gd);
    placeInGrid(gd.itemBoxes_, gd);
}

